import React, { useState, useEffect } from 'react';
import ProductCard from '../../components/ProductCard/ProductCard';

const Women = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchWomenProducts();
  }, []);

  const fetchWomenProducts = async () => {
    try {
      // Mock women's products - replace with actual API call
      const womenProducts = [
        {
          _id: '7',
          name: 'Women\'s Summer Dress',
          images: ['https://via.placeholder.com/300x300/e83e8c/ffffff?text=Summer+Dress'],
          description: 'Elegant summer dress made from high-quality cotton',
          price: 49.99,
          category: 'Women',
          brand: 'Zara',
          rating: 4.7,
          numReviews: 42,
          countInStock: 30
        },
        {
          _id: '8',
          name: 'Women\'s Handbag',
          images: ['https://via.placeholder.com/300x300/fd7e14/ffffff?text=Handbag'],
          description: 'Stylish leather handbag with multiple compartments',
          price: 79.99,
          category: 'Women',
          brand: 'Michael Kors',
          rating: 4.8,
          numReviews: 56,
          countInStock: 18
        },
        {
          _id: '9',
          name: 'Women\'s Heels',
          images: ['https://via.placeholder.com/300x300/dc3545/ffffff?text=Heels'],
          description: 'Elegant high heels for special occasions',
          price: 89.99,
          category: 'Women',
          brand: 'Steve Madden',
          rating: 4.3,
          numReviews: 29,
          countInStock: 22
        },
        {
          _id: '10',
          name: 'Women\'s Blouse',
          images: ['https://via.placeholder.com/300x300/20c997/ffffff?text=Blouse'],
          description: 'Silk blouse with delicate embroidery details',
          price: 39.99,
          category: 'Women',
          brand: 'H&M',
          rating: 4.4,
          numReviews: 34,
          countInStock: 40
        },
        {
          _id: '11',
          name: 'Women\'s Jewelry Set',
          images: ['https://via.placeholder.com/300x300/ffc107/ffffff?text=Jewelry'],
          description: 'Elegant necklace and earring set with crystals',
          price: 69.99,
          category: 'Women',
          brand: 'Swarovski',
          rating: 4.6,
          numReviews: 48,
          countInStock: 25
        },
        {
          _id: '12',
          name: 'Women\'s Athletic Wear',
          images: ['https://via.placeholder.com/300x300/28a745/ffffff?text=Athletic+Wear'],
          description: 'Comfortable and stylish athletic wear set',
          price: 59.99,
          category: 'Women',
          brand: 'Lululemon',
          rating: 4.7,
          numReviews: 52,
          countInStock: 35
        }
      ];

      setProducts(womenProducts);
    } catch (error) {
      console.error('Error fetching women\'s products:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div style={styles.loading}>Loading women's collection...</div>;
  }

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h1 style={styles.title}>Women's Collection</h1>
        <p style={styles.subtitle}>Explore our latest women\'s fashion and accessories</p>
      </div>

      <div style={styles.productsGrid}>
        {products.map(product => (
          <ProductCard key={product._id} product={product} />
        ))}
      </div>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '1400px',
    margin: '0 auto',
    padding: '2rem'
  },
  header: {
    textAlign: 'center',
    marginBottom: '3rem'
  },
  title: {
    fontSize: '2.5rem',
    color: '#333',
    marginBottom: '0.5rem'
  },
  subtitle: {
    fontSize: '1.1rem',
    color: '#666',
    maxWidth: '600px',
    margin: '0 auto'
  },
  productsGrid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fill, minmax(280px, 1fr))',
    gap: '2rem'
  },
  loading: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem'
  }
};

export default Women;
